import React from 'react';
import Button from '@material-ui/core/Button';

const Pagination = ({gotoNextPage, gotoPrevPage}) => {
    return(
        <div>
            {gotoPrevPage && 
            <Button 
            className="prevpage"
            onClick={gotoPrevPage}
            variant='outlined'
            color='primary'
            size='medium'>
                Previous Page
            </Button>}
            {gotoNextPage && <Button 
            className="nextpage"
            onClick={gotoNextPage}
            variant='outlined'
            color='secondary'
            size='medium'>
                Next Page
            </Button>}
        </div>
    )
}

export default Pagination;
